  color: white;
  border-radius: 30px;
  padding: 10px 20px;
  line-height: 18px;
`;

export const ButtonSecondary = styled.button`
  border: 1px solid grey;
  color: grey;
  border-radius: 30px;
  padding: 10px 20px;
`;
